css:
.omnisharp-atom-pane {
  position: relative;
  padding: 0px !important;
  margin: 0px;
}
.omnisharp-atom-pane .background-message {
  color: #555555;
}
.omnisharp-atom-pane .background-message kbd {
  font-size: inherit;
}
.omnisharp-atom-output-resizer {
  position: absolute;
  height: 5px;
  cursor: row-resize;
  z-index: 4;
  top: 0;
  right: 0;
  left: 0;
}
.omnisharp-atom-button progress {
  margin-top: 3px;
  width: 40px;
}
.btn-fix {
  top: -2px !important;
}
.messages-container {
  height: 150px;
  overflow-y: scroll;
}
.omnisharp-atom-output {
  overflow-y: scroll;
  height: 150px;
  position: relative;
}
.omnisharp-atom-output .error-table {
  width: 100%;
  line-height: 1.42;
}
.omnisharp-atom-output .error-table th {
  border: 1px solid #4d5257;
  border-top: 1px solid transparent;
  padding: 2px;
  padding-top: 0px;
}
.omnisharp-atom-output .error-table tr.selected {
  background-color: #4182c4;
}
.omnisharp-atom-output .error-table tr:hover {
  background-color: #4182c4;
  color: #ffffff;
  cursor: pointer;
}
.omnisharp-atom-output pre {
  background: #161719;
  color: #fff;
  font-size: 10px;
  margin: 0px;
  padding: 0px;
  border: none;
}
.omnisharp-atom-output .pending {
  color: #ff982d;
}
.omnisharp-atom-output .success {
  color: #26c26a;
}
.omnisharp-atom-output .fail {
  color: #cc0000;
}
.highlight-green .region {
  background-image: url('atom://omnisharp-atom/stylesheets/wiggle-green.png');
  background-repeat: repeat-x;
  background-position: bottom;
  margin-top: 3px;
}
.highlight-red .region {
  background-image: url('atom://omnisharp-atom/stylesheets/wiggle.png');
  background-repeat: repeat-x;
  background-position: bottom;
  margin-top: 3px;
}
.gutter .gutter-red {
  background-color: rgba(204, 0, 0, 0.3) !important;
  background-image: url('atom://omnisharp-atom/stylesheets/wiggle.png');
  background-repeat: repeat-x;
  background-position: bottom;
}
.gutter .gutter-green {
  background-color: rgba(23, 202, 101, 0.3) !important;
  background-image: url('atom://omnisharp-atom/stylesheets/wiggle-green.png');
  background-repeat: repeat-x;
  background-position: bottom;
}
